import ast


def transform_input(input_string):
    # 使用 ']' 分割输入字符串，然后移除所有的空白字符和 '['
    split_input = [i.replace('[', '').strip() for i in input_string.split(']') if i]

    # 将字符串转换为整数列表，然后转化为 bytes 格式
    transformed_output = ["bytes([" + ', '.join(i.split(' ')) + "])" for i in split_input]

    # 生成和返回最终的字符串
    return "hashes = [\n    " + ',\n    '.join(transformed_output) + ',\n]'


